    return (
        <>
            <Navbar bg="primary" variant="dark">
                <Container>
                    <Navbar.Brand href="#home">Admin Page</Navbar.Brand>
                    <Nav className="me-auto">
                        <Link to="/add-product" style={{color: 'white'}}>Add Product</Link>

                    </Nav>
                </Container>
            </Navbar>
        </>
    )
}

export default Admin
